import * as React from "react";
import { Box } from "@mui/system";
import HistoricalChart from "./historical_data";


class Chart extends React.Component {

    render () {
        return (
            <Box sx={{
                boxShadow: 10,
                borderRadius: 10,
                p: 2,
                minWidth: 1200,
                minHeight: 1200,
                color: "#0000ff"

            }} >           
                <HistoricalChart></HistoricalChart>
                <svg style={{border: "5px blue"}} />
             </Box>

        );
    };
};

export default Chart;
